DROP TABLE IF EXISTS `t_area`;
CREATE TABLE `t_area` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `area_code` int(11) DEFAULT NULL COMMENT '地区编码',
  `area_name` varchar(100) DEFAULT '' COMMENT '地区名称',
  `area_level` varchar(10) DEFAULT NULL COMMENT '地区级别',
  `parent_area_code` int(11) DEFAULT NULL COMMENT '上级地区编码',
  `parent_area_name` varchar(255) DEFAULT '' COMMENT '上级地区名称',
  `postal_code_prefix` varchar(50) DEFAULT NULL COMMENT '邮政编码前缀',
  `city_level` varchar(10) DEFAULT NULL COMMENT '城市等级',
  `city_pinyin` varchar(100) DEFAULT NULL COMMENT '城市拼音',
  `pinyin_short` varchar(50) DEFAULT NULL COMMENT '城市拼音缩写',
  `city_initials` varchar(50) DEFAULT NULL COMMENT '城市首字母',
  `name_abbreviation` varchar(255) DEFAULT NULL COMMENT '中文名称缩写',
  `is_provincial` tinyint(4) DEFAULT NULL COMMENT '是否省会城市（0 否 1 是）',
  `is_municipality` tinyint(4) DEFAULT NULL COMMENT '是否是直辖市（0 否，1 是）',
  `display_order` int(11) DEFAULT NULL COMMENT '显示顺序',
  `is_custom` char(2) DEFAULT NULL COMMENT '是否自定义地区(Y：是  N  ： 否)',
  `no_districts_or_countries` char(2) DEFAULT NULL COMMENT '不设区县的地级市（Y ：是    N：否）',
  `statu` tinyint(4) DEFAULT NULL COMMENT '状态（0作废 1 启用）',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `area_code` (`area_code`) COMMENT '地区编码'
) ENGINE=InnoDB AUTO_INCREMENT=3572 DEFAULT CHARSET=utf8 COMMENT='地区';

